import React from 'react'
import { Card } from 'antd'

const { Meta } = Card

const Home = () => {
    return (
        <div
            style={{
                marginRight: '10px',
            }}
        >
            <div
                className='suggested'
                style={{
                    marginRight: '7px',
                }}
            >
                Suggested for you
            </div>
            <div className='body-food'>
                <div
                    style={{
                        display: 'flex',
                        justifyContent: 'space-around',
                        height: '24.8rem',
                    }}
                >
                    <div></div>
                    <div></div>
                    <div></div>
                </div>
            </div>
        </div>
    )
}

export default Home
